import React from 'react'

const DestinationsList = (props) => {
    return (
        <div>
            {this.props.destination.map(dest => <li key={dest.id}>{dest.name} - {dest.city} - {dest.state} - {dest.description}</li>)}
        </div>
    )
}



export default DestinationsList
